import React, { useState } from 'react';
import axios from "axios";
import {
  Box,
  Button,
  Flex,
  Container,
  FormControl,
  FormLabel,
  Input,
  Stack,
  useToast,
  InputGroup,
  InputRightElement,
  
} from '@chakra-ui/react';
import clicksound from './Sounds/Click - Sound Effect.mp3'
import { ViewIcon, ViewOffIcon } from  '@chakra-ui/icons';
  

  const ding=(e)=>{
    const sound=new Audio(clicksound);
    sound.play();
   }

  export default function Log(){
    const [password, setPassword] = useState();
    const [show, setShow] = useState(false);
    const [email, setEmail] = useState();
    const [loading, setLoading] = useState(false);
    const toast = useToast();
    
    const handleClick = () => setShow(!show);
    const submitHandler = async () => {
      setLoading(true);
      if (!email || !password) {
        toast({
          title: 'Please fill all the fields',
          status: 'warning',
          duration: 5000,
          isClosable: true,
          position: 'top',
        });
        setLoading(false);
        return;
      }
      try {
        const config = {
          headers: {
            "Content-type": "application/json",
          },
        };
        const { data } = await axios.post(
          "http://127.0.0.1:5000/roboWar/auth/login",
          { email, password },
          config
        );
    
        toast({
          title: 'Login Successful',
          status: 'success',
          duration: 5000,
          isClosable: true,
          position: 'top',
        });
      localStorage.setItem("userInfo", JSON.stringify(data));
      } catch (err) {
        toast({
          title: 'Error Occurred!',
          description: err.response.data.message,
          status: 'error',
          duration: 5000,
          isClosable: true,
          position: 'top',
        });
      }
    
      setLoading(false);
    };
    

    return(
      <div className="gradient-background">
      <div
            class = "image"
            style = {{
            
               height: "100vh",
               width: "100vw",
              //  backgroundImage: `url(${Playgroundback})`,
              //  backgroundImage:
              // 'url("https://th.bing.com/th/id/OIP.gXZ69lTKaHxWM4frZDPtAQHaEK?w=276&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7")',
              // backgroundImage: 'url("https://www.freepik.com/premium-photo/abstract-architectural-concrete-smooth-interior-minimalist-house-with-color-gradient-neon_42257376.htm#query=dark%20theme%20playground%20background&position=30&from_view=search&track=ais")',
              backgroundSize: "cover",
              backgroundRepeat: "no-repeat",
               Color : "white",
            }}
         >
        <div class="customText">
        <Text
        fontSize="6xl"
  fontWeight="medium"
>ROBOWAR
</Text>
        <Container>
        <Flex color='white'>
        <Box w='5750px'>
          
        <FormControl isRequired>
            <FormLabel>Email</FormLabel>
        <Input
        onClick={ding}
          placeholder="Enter your name"
          bg={email ? "gray.50" : "white"}
          color="black"
          _hover={{ borderColor: "black" }}
          borderColor="black"
          onChange={(event) => {
            setEmail(event.target.value);
          }}
          value={email}
        />
        </FormControl>

        <FormControl id="password" isRequired>
        <FormLabel>Password</FormLabel>
        <InputGroup>
        <Input
        onClick={ding}
          placeholder="Enter your password"
          bg={password ? "gray.50" : "white"}
          color="black"
          _hover={{ borderColor: "black" }}
          borderColor="black"
          onChange={(event) => {
            setPassword(event.target.value);
          }}
          value={password}
        />
        <InputRightElement w="4.5em">
            <Button h="1.75em" size="sm" onClick={handleClick} color="black">
              {show ? <ViewOffIcon /> : <ViewIcon />}
            </Button>
          </InputRightElement>
        </InputGroup>
        </FormControl>
        
        </Box>
        </Flex>
        
        <Button
        colorScheme="teal"
        size="lg"
        margin={'5'}
        color="white"
        fontWeight="bold"
        borderRadius="md"
        bgGradient="linear(to-r, teal.500, green.500)"
        _hover={{
          bgGradient: 'linear(to-r, red.500, yellow.500)',
        }}
        style={{ marginTop: 15 }}
        onClick={() => {
          ding(); // Play sound effect
          submitHandler(); // Handle form submission
        }}
        isLoading={loading}
        >
          Login
        </Button>


        <Stack direction='row' spacing={4} align='center' margin={'20px'}>
            <Button fontWeight={'bold'} colorScheme='red' variant='link' onClick={ding}>
      Forgot Password?
            </Button>
            <Button fontWeight={'bold'} colorScheme='blue' variant='outline' onClick={ding}>
              Help
            </Button>
        </Stack>
        </Container>
        </div>
      </div>
</div>
        )
    };
